import React from 'react'
import styles from '../styles/Services.scss'
const Services = () => {
    return (
        <div className={styles.ServicesContainer}>
            <div>
                <h1>Servicios</h1>
            </div>
            <div>hello</div>
        </div>
    )
}

export default Services
